import React from 'react'
import Link from "next/link"
import Nav from './Nav'
import styled from "styled-components"

const Logo = styled.h1`
    font-size: 4rem;
    position: relative;
    margin: 2rem;
    z-index:2;
    transform: skew(-7deg);
    background-color: red;
    a {
        color: white;
        text-decoration: none;
        padding:0.5rem 1rem;
    }
`

const HeaderStyler = style.header`
    background
`

const Header = () => {
    return (
        <header>
           <div className="bar">
           <Logo>
              <Link href="/"> 
                 ReSell 
              </Link>
            </Logo>
           </div>
           <Nav/>
           <div className="sub-bar">
                   Search
               </div>
        </header>
    )
}

export default Header
